import React from 'react'
import { AllLayouts } from '../AllLayouts/AllLayouts'
import LayoutRegister from '../LayoutRegister/LayoutRegister'
import { CompanyName } from '../../context/CreateContext'

export const Home = () => {
  const layout = true
  const companyName="Di"
  return (
    <>{
      layout ?
      <CompanyName.Provider value={companyName}>
        <LayoutRegister companyName="companyName"/>

      </CompanyName.Provider>
       : 
       <AllLayouts />
    }
    </>
  )
}
